import React from "react";

import Title from "./Title";
import Summary from "./Summary";
import Button from "./Button";
//import "./Container.css";

const Container = props => {
    return (
        <div className={props.className}>
            <Title  />
            <Summary  />
            <Button  />
        </div>
    );
};

export default Container;
